import React from "react";
import "./App.css";
import ChatWindow from "./components/ChatWindow";

function App() {
  return (
    <div className="App">
      {/* White Top Bar */}
      <div className="top-bar">
        <div className="top-bar-logo">
          <img src="/logo.png" alt="PartSelect Logo" />
        </div>
        <div className="top-bar-phone">
          1-866-319-8402
        </div>
      </div>

      {/* Teal Navigation Bar */}
      <div className="navbar">
        <div className="logo">
          Virtual Assistant
        </div>
        <div className="nav-links">
          <a href="#">Find Product</a>
          <a href="#">Order Support</a>
        </div>
      </div>

      {/* Main Content */}
      <div className="main-content">
        <ChatWindow />
      </div>
    </div>
  );
}

export default App;
